import React from 'react';
import Card from '../components/card';
import '../style/home.css';
import makeupImage from '../path/to/makeup.jpeg'; // Adjust the path accordingly

const Home = () => {
    // ...

    return (
        <Card 
            image={makeupImage} 
            name="Nicky" 
            profession="Makeup Artist" 
            location="Phillip" 
            onBook={handleBookNow} 
        />
    );
};
